    function Footer(){
        return(
            <footer className = 'linkList'>
               <ul>
                    <li><a href="#">Home</a></li>
                    <li><a href="#">Shop</a></li>
                    <li><a href="https://github.com/syi0/LHT/">GitHub</a></li>
                    <li><a href="#">Login</a></li>
                    <li><a href="#">Register</a></li>
               </ul>
            </footer>
        );
    }

export default Footer;
